import {BrowserRouter as Switch, Route} from "react-router-dom/cjs/react-router-dom.min"
//import {BrowserRouter as Switch, Route} from 'react-router-dom'

const App = () => {
    return(
        <Switch>
            <Route path = "/" exact>
                <h1>Here!</h1>
            </Route>
        </Switch>
    )
}

export default App;
